import React,{component} from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Component from './component/Route';
class OwnerReg extends React.Component {
    render() { 
        return<>
         <BrowserRouter>
                <Routes>
                    <Route path="npm i @types/react-router-dom" element={<Component />}/>
                </Routes>
                
                </BrowserRouter>
        </>
        
    }
}
class Owner extends React.Component {
    render() { 
        return <React.Fragment>
            
                <div className="size">
                    Ashok Now You are FullStack Developer!!!
                    <OwnerReg />
                </div >
            
        </React.Fragment>;
    }
}
 
export default Owner;
